        );
      });
    });
  };

  return (
    <div className="table-container">
      <table id="workouts" className="center">
        {/* <thead>{columnElements}</thead>
        <tbody>{rowElements}</tbody> */}
        <tbody>{renderTableData()}</tbody>
      </table>
    </div>
  );
};
